            itemCategory: "Advanced",
        }]
   
    return (
       <div> <ul>{ [1, 2, 3].map(item => <li key="{item}">{item}</li>)} </ul>
        <h1>About</h1> 



       <h2>Output</h2>
      
  {  
     itemNames= nestedObject.filter(eachObj => eachObj.itemDetails.price === 1500)   }
        {/* {console.log(JSON.stringify(itemNames))} */}
  

        </div>
    )

}

export default About
